> where are the new attributes actually used? (as you do not seem to modify the generator).

It is used in the body of the method ctx during the creation of the context if needed. As the implementation (*.cpp) was not in the expected result of tests, I did not include it. 

To be clearer this is the code of the method ctx : 
	barectf_default_ctx* ctx;

	std::map<std::thread::id, barectf_default_ctx*>::iterator it;
	std::thread::id thread_id = std::this_thread::get_id();

	it = ctx_map.find(thread_id);
	if (it != ctx_map.end()){
		return it->second;
	} else {
		mtx.lock();
		std::stringstream ss;
		ss << thread_id;
		std::string string_id = ss.str();
		ctx = barectf_papy_init(metadataPath, string_id.c_str());
		ctx_map.insert(std::make_pair(thread_id, ctx));
		mtx.unlock();
	}
		return ctx;

